import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useLocation } from 'react-router-dom';
import './App.css';

// Importar componentes
import Dashboard from './components/Dashboard';
import Pacientes from './components/Pacientes';
import Clinicas from './components/Clinicas';
import Consultores from './components/Consultores';
import Agendamentos from './components/Agendamentos';

// Componente moderno para itens de navegação
const NavItem = ({ to, icon, label, isActive, description }) => (
  <Link to={to} className={`nav-item ${isActive ? 'active' : ''}`}>
    <span className="nav-icon">{icon}</span>
    <div className="nav-content">
      <span className="nav-label">{label}</span>
      {description && <span className="nav-description">{description}</span>}
    </div>
  </Link>
);

const Navigation = () => {
  const location = useLocation();
  
  const navItems = [
    { 
      to: '/', 
      icon: '📊', 
      label: 'Dashboard',
      description: 'Visão geral e métricas'
    },
    { 
      to: '/pacientes', 
      icon: '👥', 
      label: 'Pacientes',
      description: 'Gestão de leads e conversões'
    },
    { 
      to: '/agendamentos', 
      icon: '📅', 
      label: 'Agendamentos',
      description: 'Consultas e pipeline'
    },
    { 
      to: '/consultores', 
      icon: '🩺', 
      label: 'Consultores',
      description: 'Equipe de profissionais'
    },
    { 
      to: '/clinicas', 
      icon: '🏥', 
      label: 'Clínicas',
      description: 'Unidades e localização'
    },
  ];

  return (
    <nav className="sidebar">
      <div className="sidebar-header">
        <div className="logo-container">
          <div className="logo-icon">🏥</div>
          <div className="logo-text">
            <h2>HealthCRM</h2>
            <p>Sistema de Gestão de Saúde</p>
          </div>
        </div>
        <div className="header-badge">
          <span>Pro Version</span>
        </div>
      </div>
      
      <div className="nav-items">
        <div className="nav-section">
          <div className="nav-section-title">Menu Principal</div>
          {navItems.map(item => (
            <NavItem
              key={item.to}
              to={item.to}
              icon={item.icon}
              label={item.label}
              description={item.description}
              isActive={location.pathname === item.to}
            />
          ))}
        </div>
        
        <div className="nav-footer">
          <div className="user-info">
            <div className="user-avatar">👤</div>
            <div className="user-details">
              <div className="user-name">Administrador</div>
              <div className="user-role">Usuário Principal</div>
            </div>
          </div>
        </div>
      </div>
    </nav>
  );
};

function App() {
  return (
    <Router>
      <div className="App">
        <Navigation />
        <main className="main-content">
          <Routes>
            <Route path="/" element={<Dashboard />} />
            <Route path="/pacientes" element={<Pacientes />} />
            <Route path="/agendamentos" element={<Agendamentos />} />
            <Route path="/consultores" element={<Consultores />} />
            <Route path="/clinicas" element={<Clinicas />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
